pragma solidity >=0.4.23 <0.6.0;

import 'openzeppelin-solidity/contracts/ownership/Ownable.sol';
import 'contracts/Tender.sol';

contract Procurement is Ownable {
  Tender[] public tenders;

  function createTender() public returns (Tender tender) {
    tender = new Tender();
    tender.transferOwnership(msg.sender);
    tenders.push(tender);
  }

  function tendersSize() public view returns (uint) {
    return tenders.length;
  }
}
